import React, { Component } from "react";

class Navbar extends Component {
  render() {
    return (
      <nav className="navbar navbar-light bg-light">
        <p className="navbar-brand">Navbar</p>
        <p>{this.props.countersLength}</p>
      </nav>
    );
  }
}

export default Navbar;
